import './App.css';

function App() {
  return (
    <div>
      <h1>Welcome to Easy Tracking!</h1>
      <p>Login Page</p>
      <Auth />

    </div>
  );
}

function Auth() {
  return (
    <form action="/submit" method="post">
      <div>
        <label>Email: </label>
        <input type="email" placeholder='Please enter your Email' style={{ width: '200px', marginLeft: '23px'}} required title="Please enter a valid email" />
      </div>
      <div>
        <label>Password: </label>
        <input type="password" placeholder='Please enter your Password' style={{ marginRight: '10px', width: '200px' }} required />
      </div>
      <button type="submit">Submit</button>
    </form>
  )
}


export default App;
